import React from 'react';
import './navbar.css';
import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.css';

const Navbar = ({ onPageChange, userType }) => {
  return (
    <nav className='bg-success bg-gradient'>
      <div className='container-fluid' style={{display:'flex', justifyContent:'space-between'}}>

        <div>
          <a href='https://www.google.com/'>
            <img src='https://www.svnit.ac.in/conference/frsm2023/hit/svnit_logo.png' alt="logo" height="40px"></img>
          </a>
          <button className='btn navbar-brand'>SVNIT Dispensary</button>
        </div>

        <div style={{justifyContent:'space-between'}}>
          <button className='btn' href="#" onClick={() => onPageChange('profile')}><strong>Profile</strong></button>
          <button className='btn' href="#" onClick={() => onPageChange('appointments')}><strong>Appointments</strong></button>
          {userType ? (
            <>
              <button className='btn' href="#"  onClick={() => onPageChange('medicalHistory')}><strong>Medical History</strong></button>
              <button className='btn' href="#" onClick={() => onPageChange('vaccinationHistory')}><strong>Vaccines</strong></button>
              <button className='btn' href="#" onClick={() => onPageChange('testList')}><strong>Tests</strong></button>
            </>  
          ) : (
          <button className='btn' href="#" onClick={() => onPageChange('all-medicine')}><strong>All Medicines</strong></button>
          )}
          <button className='btn'>
            <Link to="/login" className='nav-link'><strong>Logout</strong></Link>
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
